DEFINE TENANT_ID = '&1'
SET FEEDBACK ON
SET SERVEROUTPUT ON

REM Update ITA OOBs according to latest LA side change
DECLARE
  V_COUNT NUMBER;
BEGIN
  SELECT COUNT(1) INTO V_COUNT FROM EMS_DASHBOARD_TILE WHERE TENANT_ID='&TENANT_ID' AND PROVIDER_NAME ='EmcitasApplications'  AND PROVIDER_ASSET_ROOT='ita-dashboard' AND DASHBOARD_ID IN (11,12,13);
  IF (V_COUNT=0) THEN
    DBMS_OUTPUT.PUT_LINE('ITA OOBs PROVIDER_ASSET_ROOT have been updated for: &TENANT_ID, no need to update again');  
  ELSE
    UPDATE EMS_DASHBOARD_TILE
    SET PROVIDER_ASSET_ROOT  ='flex-analyzer' 
    WHERE PROVIDER_NAME ='EmcitasApplications' 
    AND TENANT_ID='&TENANT_ID' 
    AND PROVIDER_ASSET_ROOT='ita-dashboard' 
    AND DASHBOARD_ID IN (11,12,13);
    COMMIT;
    DBMS_OUTPUT.PUT_LINE('Update ITA OOBs PROVIDER_ASSET_ROOT in Schema object: EMS_DASHBOARD_TILE successfully for tenant: &TENANT_ID');  
  END IF;
EXCEPTION
WHEN OTHERS THEN
  ROLLBACK;
  DBMS_OUTPUT.PUT_LINE('Failed to update ITA OOBs PROVIDER_ASSET_ROOT in Schema object: EMS_DASHBOARD_TILE for tenant: &TENANT_ID due to '||SQLERRM);   
  RAISE;
END;
/

